import { combineReducers } from 'redux';
import memoReducer from './reducers/MemoReducer'; // 메모 리듀서를 가져옵니다.
import userReducer from './reducers/'


const rootReducer = combineReducers({
  memo: memoReducer,
  user:userReducer,
});

export default rootReducer;
